import React, { useState } from 'react';
import './card.css'

const card = (props) => {
    const {name, image, salary} = props.card;
    return (
        <div id="card">
            <div id="image">
                <img src={image} alt="" />
            </div>
            <div className="name">
                <h3>{name}</h3>
                <small>Salary is:- ${salary}</small>
                <br /> <br />
                <button onClick={() => props.handleAddCrickter(props.crickter )}>Select</button>
                
            </div>

        </div>
    );
};

export default card;
